/* color-org/src/components/StarRating.js */
import React from "react";
import { FaStar } from "react-icons/fa";

export default function StarRating(){
    return [
    <FaStar color="red" />,
    <FaStar color="red" />,
    <FaStar color="red" />,
    <FaStar color="grey" />,
    <FaStar color="grey" />
    ];
}
